--  DDL for Trigger TR_ABA_FAC_DET_STOCK
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "ABACERIA"."TR_ABA_FAC_DET_STOCK" 
--BEFORE o AFTER
AFTER INSERT OR UPDATE ON ABA_FACTURAS_DETALLE

--FOR EACH ROW
DECLARE
    
    var_fac_det_id NUMERIC;
    pro_id NUMERIC;
    det_cantidad NUMERIC;

BEGIN

    SELECT MAX(fac_det_id)
    INTO var_fac_det_id
    FROM aba_facturas_detalle;


    SELECT aba_productos_pro_id
    INTO pro_id
    FROM aba_facturas_detalle
    WHERE fac_det_id = var_fac_det_id;

    SELECT fac_det_cantidad
    INTO det_cantidad
    FROM aba_facturas_detalle
    WHERE fac_det_id = var_fac_det_id;

    actualizar_stock(pro_id, det_cantidad);

END tr_aba_fac_det_stock;
/
ALTER TRIGGER "ABACERIA"."TR_ABA_FAC_DET_STOCK" ENABLE;
--------------------------------------------------------
--  DDL for Procedure ACTUALIZAR_STOCK
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "ABACERIA"."ACTUALIZAR_STOCK" (var_pro_id IN aba_productos.pro_id%TYPE, var_cantidad IN aba_productos.pro_stock%TYPE)
                                            
IS

BEGIN

    UPDATE aba_productos
    SET
    pro_stock = pro_stock - var_cantidad
    WHERE pro_id = var_pro_id;



END actualizar_stock;

