--  DDL for Function OBTENER_VENTAS
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "ABACERIA"."OBTENER_VENTAS" (var_fecha IN DATE)

RETURN VARCHAR2 
--RETURN NUMBER

IS

var_ventas NUMBER;

BEGIN

SELECT SUM(FAC_CAB_TOTAL)
INTO var_ventas
FROM aba_facturas_cabecera
WHERE var_fecha = fac_cab_fecha;

RETURN to_char(var_ventas,'L9999,999.99');

END obtener_ventas;

